import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "Your Profile" link
    const profileLink = page.getByRole('link', { name: 'Your Profile' }).first();
    await profileLink.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click.png'));

    await profileLink.click();

    // Wait for the profile page content to load and verify
    const profileHeader = page.getByRole('heading', { name: 'Jun Kim' });
    await profileHeader.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_page.png'));

    // Extract data to confirm the action
    const username = await page.locator('p.username').textContent();
    const bio = await page.locator('p.bio').textContent();

    return {
      success: true,
      action: "Navigated to Jun's Profile page",
      extractedData: {
        profileName: await profileHeader.textContent(),
        username: username,
        bio: bio
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshots = [];
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
      console.error('Failed to take error screenshot:', e);
    }

    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
